import {makeStyles} from '@material-ui/core/styles'

const useStyles = makeStyles((theme)=>({
   appbar : {
       background:'#000'
   },

   toolbar:{
       justifyContent:'space-between'
   },
   typography:{
       cursor:'pointer',
       fontSize:'1.5rem',
       displayItems:'center',
       marginLeft:'24px',
       fontWeight:'bold'
   },
   iconbutton:{
       display:'block',
       position:'absoulte',
       top:'0',
       rigth:'0',
       transform:'translate(-100%,60%)',
       fontSize:'1.8rem',
   },
   menuicon:{
       color:'#fff'
   },
   list:{
       display:'flex',

   },
   listitem:{
       cursor:'pointer',

       '&:hover':{
           borderBottom:'2px solid #fff'
       }
   },
   button:{
       fontSize:'1rem',

       '&:hover':{
           backgroundColor:'#222',
           color:'#fff',
           border:'1px solid #fff'
       }

   }

}))

export  default useStyles
